DROP TABLE IF EXISTS `zxgj_users`;
CREATE TABLE `zxgj_users` (
  `u_Id` int(10) NOT NULL AUTO_INCREMENT COMMENT '用户ID',
  `u_Account` varchar(128) NOT NULL COMMENT '用户账号',
  `u_Email` varchar(256) NOT NULL COMMENT '用户真实邮箱',
  `u_RealName` varchar(64) NOT NULL COMMENT '用户真实姓名',
  `u_Pwd` varchar(128) NOT NULL DEFAULT '' COMMENT '系统生成的用户随机密码',
  `u_Recommander` varchar(64) NOT NULL COMMENT '推荐人',
  `u_Mobile` varchar(32) NOT NULL COMMENT '用户手机号',
  `u_Address` varchar(512) NOT NULL COMMENT '用户地址',
  `u_IDcard` varchar(20) NOT NULL COMMENT '用户身份证号',
  `u_BankCardNumber` varchar(255) NOT NULL COMMENT '银行卡号',
  `u_BankType` varchar(255) NOT NULL COMMENT '所属银行',
  `u_Branch` varchar(255) NOT NULL DEFAULT '' COMMENT '所属银行/分行/支行',
  `u_CurrencyType` varchar(255) NOT NULL COMMENT '交易货币',
  `u_IDcardFront` varchar(255) NOT NULL COMMENT '身份证正面照的URL',
  `u_IDcardBack` varchar(255) NOT NULL,
  `u_BankCardFront` varchar(255) NOT NULL,
  `u_PostureImg` varchar(255) NOT NULL,
  `u_Regtime` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '用户注册时间',
  `u_Ifreview` varchar(8) DEFAULT '0' COMMENT '会员审核状态1 review or  0pending',
  `u_Group` varchar(255) DEFAULT '0' COMMENT '会员所在的组,默认为0',
  `u_Memo` varchar(512) DEFAULT '' COMMENT '用户备注信息',
  PRIMARY KEY (`u_Id`),
  KEY `User` (`u_Id`,`u_Account`,`u_Email`(255),`u_RealName`,`u_Mobile`,`u_IDcard`)
) ENGINE=InnoDB AUTO_INCREMENT=507 DEFAULT CHARSET=utf8 COMMENT='用户信息表';

